app.controller("indexController",["$scope","$http",(d,e)=>{d.indexAdsLoading=!0,d.init=(()=>{d.getIndexAds()}),d.ads={},d.getIndexAds=(()=>{e({url:"/getIndexAds",method:"GET"}).then(e=>{d.indexAdsLoading=!1,d.ads=e.data},()=>{console.log("fail")})}),d.searchForm={},d.onSubmit=(()=>{d.indexAdsLoading=!0,e({url:"/searchAd",method:"get",params:{title:d.searchForm.title}}).then(e=>{console.log(e),d.indexAdsLoading=!1,d.ads=e.data},()=>{console.log("fail")})})}]);